from PyQt5 import QtWidgets as qtwclass NamelistQFrame(qtw.QFrame):    def __init__(self, default_par):        super().__init__()        self.default_par = default_par        self.InitListUI()    def InitListUI(self):        scroll = qtw.QListWidget()        for namelist in self.default_par.namelists:            scroll.addItem(namelist.name)           layout = qtw.QVBoxLayout()        layout.addWidget(scroll)        self.setLayout(layout)